package io.swagger.model;import io.swagger.annotations.ApiModelProperty;import lombok.AllArgsConstructor;import lombok.Data;import lombok.NoArgsConstructor;import javax.persistence.Entity;import javax.persistence.GeneratedValue;import javax.persistence.GenerationType;import javax.persistence.Id;@Data@AllArgsConstructor@NoArgsConstructor@Entitypublic class Bazar {    @Id    @GeneratedValue(strategy = GenerationType.AUTO)    @ApiModelProperty(hidden = true)    private long bazarNo;    private String name;    private double unit;    private double costPerUnit;    @Override    public String toString() {        return name+"--unit: "+unit+"--unitPrice: "+costPerUnit;    }}